import React from "react";

const AgregarTrabajos = () => {
  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-success">
      <div className="card p-4 p-md-5 shadow-lg text-center" 
      style={{ 
        maxWidth: "1200px", 
        width: "100%", 
        height: "90vh",
        borderRadius:"20px",
        overflow:"hidden"
        }}
        >

          <div className="d-flex justify-content-between mb-3">
            <img src="/images/logosdc.jpg" alt="Logo SDC" 
            style={{
              width: "50px",
              height: "50px",
              borderRadius: "50%"
            }}/>
          </div>

      </div>
    </div>
  );
};

export default AgregarTrabajos;
